import React from "react"
import "./style.css"


const Nav = () => {
    return (
        <Router>
            <div className="main-nav">
                <img className="placeholder-logo" src="./images/placeholder-logo.jpeg"></img>
                    <a href>Home</a>
                    <a href>Employees</a>
                    <a href>Log Out</a>
            </div>
        </Router>
    )
};

export default Nav;
